import React, { Component } from 'react';
import './App.css';
import Events from './components/Events';
import NaviBar from './components/NaviBar';

class App extends Component {


  render() {
    return (
      <div>
        <NaviBar/>
        <div className = "my_info_banner"><div id = "location_icon"></div><p style = {{"display": "inline-block"}}><i>695 Park Ave, New York, NY 10065</i></p></div>
        <div className = "view-wrap">
        	<div className = "filter_wrap"><div className = "filter_content"></div></div>
	        <div className = "events_wrap">
	      	  <Events/>
	        </div>
        </div>
      </div>

    );
  }
}

export default App;
